CREATE TABLE Team
(
    TeamID INTEGER PRIMARY KEY,
    ShortName TEXT,
    Name TEXT,
    Wins INTEGER,
    Losses INTEGER,
    Championships INTEGER,
    LocationID INTEGER
);



CREATE TABLE Location
(
    LocationID INTEGER PRIMARY KEY,
    City TEXT,
    State TEXT,
    Country TEXT
);




CREATE TABLE Person
(
    PersonID INTEGER PRIMARY KEY,
    FirstName TEXT,
    LastName TEXT,
    TeamID INTEGER,
    HomeTownID INTEGER
);




CREATE TABLE Player
(
    PersonID INTEGER PRIMARY KEY,
    Number INTEGER,
    HeightInches INTEGER,
    WeightPounds INTEGER,
    Position TEXT,
    AcademicYear TEXT,
    HighSchool TEXT
);





CREATE TABLE Coach
(
    PersonID INTEGER PRIMARY KEY,
    Title TEXT
);



